import { useEffect, useState} from 'react';
import { Switch, Route, Link, useRouteMatch } from 'react-router-dom';
import './MyAnnonces.css';
import { instanceAxs } from '../../../api/Api';

function MyAnnonces(){

    let { path,url } = useRouteMatch();
    const [annonces, setAnnonces] = useState([{annonceId: "3422"}]);

    useEffect(() => {
        instanceAxs.get('/myannonces')
            .then(result => {
                setAnnonces(result.data.annonces);
            })
    })
    return(
        <div>
            <input type="text" className="form-control myAnnoncesSearchField" placeholder="Søk i Mine Annonser..."></input>
            <Link to={`${url + '/' + annonces[0].annonceId}`}>Your annonce</Link>

            <Switch>
                <Route path={`${path}/:annonceId`} render={ (props) => <User example="something" { ...props } /> }>
                </Route>
            </Switch>
        </div>
    )
}

export default MyAnnonces;
